import React from "react";
import PropTypes from "prop-types";

import {
  Card,
  WrapperInput,
  SmallLabel,
  Row,
  Input,
  InputCVV,
  InputCard,
  InputDate,
  Button,
  CreditCard,
  Back,
  Info,
  Baseline,
  Quantity,
  Total,
} from "./styles";

function MobileForm({ width }) {
  function renderCreditCard() {
    return (
      <>
        <Card />
        <WrapperInput>
          <SmallLabel>número do cartão</SmallLabel>
          <InputCard placeholder="0000 0000 0000 0000" />
        </WrapperInput>
        <Row>
          <WrapperInput>
            <SmallLabel>CVV</SmallLabel>
            <InputCVV placeholder="000" />
          </WrapperInput>
          <WrapperInput>
            <SmallLabel>expiração</SmallLabel>
            <InputDate placeholder="00/0000" />
          </WrapperInput>
        </Row>
        <WrapperInput>
          <SmallLabel>nome do proprietário</SmallLabel>
          <Input placeholder="nome do proprietário" />
        </WrapperInput>
        <Button>
          <CreditCard />
        </Button>
        <Back>voltar</Back>
      </>
    );
  }

  function renderBillet() {
    return <></>;
  }

  return <>{renderCreditCard()}</>;
}

MobileForm.propTypes = {
  width: PropTypes.number,
};

MobileForm.defaultProps = {
  width: window.innerWidth,
};

export default MobileForm;
